import Circles from './assets/Circles.svg';
import logo from './assets/logo.svg';
import './App.css';
import Typical from 'react-typical';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo "/>
        <img src={Circles} className="App-circles" alt="circles"/> 
        <Typical
        className="App-circles-text"
        steps={['Young.', 1300, 'Belgian.', 1300, 'Freelancer.', 1300, 'UX designer.', 1300, 'Self-learner.', 1300]}
        loop={Infinity}
        wrapper="h1"
        />
      </header>
    </div>
  );
}

export default App;
